const gallery = [
    {
        id : 1,
        url : "data:image/jpeg;base64,",
        caption : "Nature"
    },
    {
        id : 2,
        url : "data:image/jpeg;base64,",
        caption : "City"
    },
    {
        id : 3,
        url : "data:image/jpeg;base64,",
        caption : "Forest"
    }
];
const Gallery=()=>{
    return (
        <>
            {gallery.map(e=>(

                <div key={e.id}>
                <img src={e.url} alt={e.caption} />
                </div>
            )
            )}
        </>
    )
}

export default Gallery